INSERT INTO `candidateprofileparams` VALUES (2478,NULL,'IH','IIHT',NULL,NULL,'2019-01-28 12:00:28',NULL,NULL,'Not bad!. Folks, on average, on GK front are like you','Pretty Good. Better than average. Would always have some thing to talk in most conversation\'s','Not adequate. Need to get better','Pretty poor. Not suitable for jobs where job profile is horizontal - little bit of everything','Exceptional.  High scorers on tests of general knowledge tend to also score highly on intelligence tests. Highly recommended','General Knowledge','NA','NA','NA','NA','NA'),(2659,NULL,'IH','IIHT','2019-01-28 12:00:29',NULL,NULL,NULL,NULL,'Not bad!. Around 70 % of folks fall in this category','Pretty Good. Better than average. Has good potential in a Programming career','Not adequate. But can be groomed to be better','Pretty poor. Not suitable for Programming Jobs that requires a bit of analysis','Exceptional.  Have a potential to be a Champion','Mathematical Reasoning','NA','NA','NA','NA','NA'),(2660,NULL,'IH','IIHT','2019-01-28 12:00:29',NULL,NULL,NULL,NULL,'Not bad!. Around most folks fall in this category','Pretty Good. Better than average. Has a knack with words','Lower - Intermediate. But can be groomed to be better','Beginner\'s Level. Not suited for public facing jobs','Exceptional.  Have a distinct flair with words. Recommended for public facing Jobs','Vocabulary','NA','NA','NA','NA','NA'),(2661,NULL,'IH','IIHT','2019-01-28 12:00:29',NULL,NULL,NULL,NULL,'Average. The verbal test’ s level of difficulty is determined by four main factors – the length of the reading passage, complexity of the text, use of higher language rather than simple words, and time constraints. ','Pretty Good. The verbal test’ s level of difficulty is determined by four main factors – the length of the reading passage, complexity of the text, use of higher language rather than simple words, and time constraints. ','Lower - Intermediate. The verbal test’ s level of difficulty is determined by four main factors – the length of the reading passage, complexity of the text, use of higher language rather than simple words, and time constraints. ','Beginner\'s Level. The verbal test’ s level of difficulty is determined by four main factors – the length of the reading passage, complexity of the text, use of higher language rather than simple words, and time constraints. ','Exceptional.  The verbal test’ s level of difficulty is determined by four main factors – the length of the reading passage, complexity of the text, use of higher language rather than simple words, and time constraints. ','Verbal Reasoning','NA','NA','NA','NA','NA'),(2662,NULL,'IH','IIHT','2019-01-28 12:00:29',NULL,NULL,NULL,NULL,'Average. Can apply information or concepts in a new way','Pretty Good. Has the ability to justify or defend a stand','Lower - Intermediate. Can explain basic ideas or concepts','Pretty Elementary. Can have basic ability to recall or remember the information','Exceptional.  Can create a new point of view','Reasoning','NA','NA','NA','NA','NA'),(2663,NULL,'IH','IIHT','2019-01-28 12:00:29',NULL,NULL,NULL,NULL,'Typical to most folks','Has reasonably good temperament','Can be bit sensitive and reluctant to change. May prefer known surroundings and as such can hang on better than others - if thats what you are looking for','Energy levels change from low to high and other way round in a jiffy. Highly sensitive. Low predictability. May have Withdrawal symptoms. Slow to adapt. Moody. High Distractability!','Exceptional Temperament','Low Temperament','NA','NA','NA','NA','NA'),(2664,NULL,'IH','IIHT','2019-01-28 12:00:29',NULL,NULL,NULL,NULL,'Typical to most folks','Can be bit sensitive and reluctant to change. May prefer known surroundings and as such can hang on better than others - if thats what you are looking for','Has reasonably good temperament','Exceptional Temperament','Energy levels change from low to high and other way round in a jiffy. Highly sensitive. Low predictability. May have Withdrawal symptoms. Slow to adapt. Moody. High Distractability!','Good Temperament','NA','NA','NA','NA','NA'),(2665,NULL,'IH','IIHT','2019-01-28 12:00:29',NULL,NULL,NULL,NULL,'Typical to most folks','Pretty Honest! Such guys can be long term investment','Trust will come at a price','Can have Integrity Problems','Exceptional - Too good to be true or too honest to be good','Honesty','NA','NA','NA','NA','NA'),(2666,NULL,'IH','IIHT',NULL,NULL,'2019-01-28 12:00:29',NULL,NULL,'Typical to most folks','Good Networking Skills. At ease in most jobs','Have basic Social skills. Can work as individual contributors','Pretty Poor Social Skills','Exceptional - Best folks to be around and can be fun','Social','NA','NA','NA','NA','NA'),(2667,NULL,'IH','IIHT','2019-01-28 12:00:30',NULL,NULL,NULL,NULL,'Typical to most folks','Pretty good! Loves order and discipline in the way they work','Poor Time Management - Can be a concern while working in a team','Negligent Time Management, Can not be trusted','Extremely organized - For teams that values processes & structure, folks in this category can be remarkable assets','Time Management','NA','NA','NA','NA','NA'),(2668,NULL,'IH','IIHT','2019-01-28 12:00:30',NULL,NULL,NULL,NULL,'Typical to most folks','Pretty good! Result oriented','Being organized is not a trait you thrive on. ','Poor, Can not be trusted','Excellent - Have traits to deliver results not just at individual but also at team level','Efficiency','NA','NA','NA','NA','NA'),(2669,NULL,'IH','IIHT','2019-01-28 12:00:30',NULL,NULL,NULL,NULL,'Typical to most folks','Pretty Ambitious - Can be a great investment','Not much ambitious - However can be inspired to play their part ','Least Ambitious - If they deliver decent productivity, can be the ones who may stick with you the most','Highly Ambitious - If they have the tools along with the ambition, they can go a long way.','Ambition','NA','NA','NA','NA','NA'),(2670,NULL,'IH','IIHT','2019-01-28 12:00:30',NULL,NULL,NULL,NULL,'Typical to most folks','High - Confident and self aware','Need to improve a bit - Would be defensive in pressure situations ','Pretty Low! Very defensive mindset','Excellent - Can be a \'go to\' man if he or she know what they are doing','Self Esteem','NA','NA','NA','NA','NA'),(2671,NULL,'IH','IIHT','2019-01-28 12:00:30',NULL,NULL,NULL,NULL,'Typical to most folks','High - Can adjust well to a dynamic work environment','Need to improve a bit to fit in a dynamic work environment. ','Pretty Low!','Excellent - Would be a fish in water in a dynamic work environment','Creativity','NA','NA','NA','NA','NA'),(2672,NULL,'IH','IIHT','2019-01-28 12:00:30',NULL,NULL,NULL,NULL,'Average','Good - Has a basic understanding on Core Java. Can Program','Need to improve a lot.  Would require some training to fit in. Need a bettwen understanding on Collections, Multi-Threading, JDBC, basic Design Patterns or related core concept','Poor concepts!','Excellent on basic concepts','Java','NA','NA','NA','NA','NA'),(2673,NULL,'IH','IIHT','2019-01-28 12:00:30',NULL,NULL,NULL,NULL,'Average - Not bad!, need to be groomed to understand advanced profiling techniques','Good - Has a good handle on JVM concepts and can be trusted to profile applications','Need to improve. Need to be trained to analyse and profile applications at run time for problems related to performance and scalability.','Poor concepts! Having a basic JVM knowledge is a must to understand application behaviour at run time.','Excellent! Good fit. Can understand and analyze heap dumps and thread stacks, profilers and debuggers since good in concepts','Java','JVM','NA','NA','NA','NA'),(2674,NULL,'IH','IIHT','2019-01-28 12:00:30',NULL,NULL,NULL,NULL,'Average - Not bad!, Can be a decent fit. Won\'t be difficult to understand application behaviour in following areas - concurrency, scalability and data integrtity','Good Multi Threading Concepts','Need to improve. Can be trained on areas of concurrency, scalability and data integrtity  - all a consequence of how well your system is multi-threaded.','Poor concepts! Basic threading concepts are a must in a Programming job irrespective of technology','Excellent! ','Java','Threading','NA','NA','NA','NA'),(2675,NULL,'IH','IIHT','2019-01-28 12:00:30',NULL,NULL,NULL,NULL,'Average - Not bad!, Spring is pretty vast - Core, Spring MVC, Spring JDBC, Spring Transactions, ORM, JNDI, Security, Integration & more. Should fit in well','Good. Spring is pretty vast - Core, Spring MVC, Spring JDBC, Spring Transactions, ORM, JNDI, Security, Integration & more. can relate to areas on Spring even if have not worked','Need to improve a lot. Spring is pretty vast - Core, Spring MVC, Spring JDBC, Spring Transactions, ORM, JNDI, Security, Integration & more. Need to be trained to qualify','Poor concepts! Can\'t work on projects with Spring as middleware','Excellent! Though Spring is pretty vast - Core, Spring MVC, Spring JDBC, Spring Transactions, ORM, JNDI, Security, Integration & more, this candidate sounds like a top fit.','Java','Spring','NA','NA','NA','NA'),(2676,NULL,'IH','IIHT','2019-01-28 12:00:30',NULL,NULL,NULL,NULL,'Average - Not bad!, Has a basic undestanding on Hibernate Sessions, Session Factory & related stuff','Good fit','Need to improve a bit. Hibernate as ORM is pretty critical in transactional applications. Need to be trained beforehand.','Poor concepts! Can\'t work on projects with Hibernate as ORM','Excellent! Can work on projects that leverages a lot of Hibernate to improve query performance, scale better and maintain data integrity','Java','Hibernate','NA','NA','NA','NA'),(2677,NULL,'IH','IIHT','2019-01-28 12:00:30',NULL,NULL,NULL,NULL,'Average - Not bad!, Can solve basic, day-to-day design problems without much assistance','Good. Good thinker and analyzer. Has the potential to translate a problem statement into a good design ','Need to improve a bit. Can\'t translate a problem statement into an acceptable design, though can make the code run','Poor concepts! Can\'t translate a problem statement into an working design','Excellent! Good thinker and analyzer. Has the potential to translate a problem statement into a good design keeping future concerns (adaptibility, scalability, performance and so) in mind ','Design Patterns','NA','NA','NA','NA','NA'),(2678,NULL,'IH','IIHT','2019-01-28 12:00:30',NULL,NULL,NULL,NULL,'Average Programming Skills, ','Good Programming Skills','Elementary Programming Skills.','Poor Programming skills! Can\'t code','Excellent Programming Skills','Coding_Java','NA','NA','NA','NA','NA');
