INSERT INTO `question` VALUES (2,NULL,'V2','V2 Technologies',NULL,NULL,NULL,NULL,NULL,'Never - Serial Garbage Collection was the first GC mode made available in JVM. Nowadays there are much better GC strategies available.','When your application creates huge number of objects on the heap.','When you’re on a single CPU, or in a scenario where there are more VMs running on the machine than CPUs.',NULL,NULL,NULL,'EASY','EASY','Java','JVM',NULL,NULL,NULL,'When does one configure JVM in serial Garbage Collection mode?','Choice 3',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(3,NULL,'V2','V2 Technologies',NULL,NULL,NULL,NULL,NULL,'1 object on the heap','1 object on the stack.','1 object in the String pool Area','2 objects. 1 object in the heap and 2nd object in the stack constant pool',NULL,NULL,'EASY','EASY','Java',NULL,NULL,NULL,NULL,'If there is a following code - See below in one of your methods in your class. Af if that method is executed, then how many objects are created in the JVM\n\nString str = new String(\"Hello World\");','Choice 4',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(4,NULL,'V2','V2 Technologies',NULL,NULL,NULL,NULL,NULL,'Bootstrap class loader loads the basic classes from Java library, like java.*, javax.*. This is the root in the class loader hierarchy.','Loads jar files from JDK extensions directory - usually lib/ext directory of the JRE','Loads classes from system classpath.',NULL,NULL,NULL,'EASY','DIFFICULT','Java',NULL,NULL,NULL,NULL,'What is the function of Bootstrap Class loader?','Choice 1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(5,NULL,'V2','V2 Technologies',NULL,NULL,NULL,NULL,NULL,'Instance variable are on stack, while static variables are on heap.','Both instance and static variables are on heap.','Static variables are on stack, while instance variables are on heap',NULL,NULL,NULL,'EASY','EASY','Java',NULL,NULL,NULL,NULL,'In JVM, Which memory areas does instance and static variables use ?','Choice 1',NULL,NULL,NU